import React from "react";
import {
  Background,
  ModalWrapper,
  ModalCotent,
  CloseModal,
} from "../../../styledComponents/Dashboard/Modals/viewProjectsModal";

const ViewProjects = () => {
  return (
    <div>
      <Background>
        <ModalWrapper>
          <ModalCotent>Hello World</ModalCotent>
        </ModalWrapper>
        <CloseModal>&times;</CloseModal>
      </Background>
    </div>
  );
};

export default ViewProjects;
